import React from "react"
import CharacterButton from "./CharacterButton";

function CharacterMenu( { characters , teamChars , setTeamChars} ) {

    const buttons = characters.map((char) => {
        return (
            <>
                <CharacterButton key={char.id.toString()} char={char} image={char.images.pixelImage} teamChars={teamChars} setTeamChars={setTeamChars}/>
                {char.id === 15 ? <br/>: null}
                {char.id === 29? <br/> : null}
            </>
                )
    })

    function patch(e) {
        e.preventDefault()
        const filler = {
        "point": [
            "",
            ""
          ],
          "mid": [
            "",
            ""
          ],
          "anchor": [
            "",
            ""
          ]
        }
          characters.map((char) => {
          fetch(`http://localhost:3000/characters/35`, {
              method : 'PATCH',
              headers : { "content-type" : "application/json"},
              body : JSON.stringify({ positions : filler})
            })
          })
    }

    return(
        <div>   <button onClick={(e) => patch(e)}> GYOUBHJIUHYUG</button>

            {buttons}
        </div>
    )

}

export default CharacterMenu;
